import React, { Component } from "react";
import { Button, Container } from "react-bootstrap";
import UserConsumer from "../context";
import { Popover, OverlayTrigger } from "react-bootstrap";
import UpdatePopover from "../forms/UpdatePopover";

class UpdateUser extends Component {
  render() {

    return (
      <UserConsumer>
        {(value) => {
          return <button type="button" class="btn btn-lg btn-primary" data-toggle="popover" title="Popover title" data-content="And here's some amazing content. It's very engaging. Right?">Click
          to toggle popover</button>;
        }}
      </UserConsumer>
    );
  }
}
export default UpdateUser;
